css:
@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document domain("techcrunch.com") {

/*text&background*/

html, body, tbody, thead, th, tr, td, blockquote, li, ul, h1, h2, h3, h4, h5, h6, p, form, footer, .module-header .middle-container, .module-header .bottom-container, .featured-post-row

{
color: white !important;
background: black !important;
}

/*links*/

a

{
color: #0040ff !important;
}

/*highlight*/

textarea, pre

{
background: #333333 !important;
}

}
